WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Sveiki!

WordPress užfiksuoja, kai naudojama tema arba įskiepis sukelia klaidą Jūsų tinklalapyje ir informuoja Jus šiuo automatiniu el.laišku.
###CAUSE###
Pirmiausia, aplankykite savo tinklalapį (###SITEURL###) ir patikrinkite ar matote akivaizdžių klaidų. Po to, aplankykite puslapį, kuriame užfiksuota klaida (###PAGEURL###) ir patikrinkite, ar ten matote klaidų.

###SUPPORT###

Jei Jūsų tinklalapis neveikia ir Jūs negalite įprastai pateikti į jo valdymo skydelį, galite pasinaudoti specialia WordPress funkcija "atstatymo režimas". Ji leidžia Jums saugiai prisijungti prie valdymo skydelio ir toliau ieškoti klaidų priežasties.

###LINK###

Norint apsaugoti Jūsų tinklalapį, ši nuoroda galios iki  ###EXPIRES###. Tačiau nesijaudinkite dėl šio apribojimo, nes jei klaida tinklalapyje vėl bus fiksuojama, Jums automatiškai bus atsiųsta ir nauja prisijungimo nuoroda.

Ieškant pagalbos šiai klaidai spręsti, Jums gali būti naudinga ši informacija:
