ll new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'Negalėsite įdiegti naujų temų čia, nes Jūsų WordPress reikalauja SFTP prisijungimo duomenų. Tuo tarpu, galite <a href="%s">diegti temas per valdymo skydelį</a>.','categoriesMost Used'=>'Dažniausai naudotos','tagsMost Used'=>'Dažniausiai naudotos','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Spauskite &#8220;Toliau&#8221; ir pridėkite nuorodas į naująjį meniu.','customizer changeset action/button labelSchedule'=>'Suplanuoti','+ Create New Menu'=>'+ Sukurti naują meniu','Create a menu for this location'=>'Sukurti meniu šiai vietai','Could not open handle for %1$s to %2$s.'=>'Nepavyko atidaryti %2$s su %1$s.','Add a navigation menu to your sidebar.'=>'Pridėkite navigacijos meniu į šoninę juostą.','%s has taken over and is currently customizing.'=>'%s perėmė ir šiuo metu tvarko.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'Įvyko klaida. Palaukite keleta sekundžių ir bandykite vėl.','Take over'=>'Perimti','Go back'=>'Atgal','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s dabar tvarko šį tinklalapį. Prašome palaukti kol baigs tvarkyti. Jūsų naujausi pakeitimai buvo automatiškai išsaugoti.','%s is already customizing this site. Do you want to take over?'=>'%s dabar tvarko šį tinklapį. Ar norite perimti?','Sorry, you are not allowed to take over.'=>'Deja, Jūs negalite perimti.','No changeset found to take over'=>'Nėra rasta pakeitimų rinkinių perėmimui','Security check failed.'=>'Saugumo patikra nepavyko.','Changeset is being edited by other user.'=>'Pakeitimų rinkinys yra redaguojamas kito vartotojo.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Štai kur bus rodomas šis meniu. Jei norite tai pakeisti, pasirinkite ki