###SITEURL###','Only UUID V4 is supported at this time.'=>'Šiuo metu palaikoma tik UUID V4.','The Press This plugin is required.'=>'Press This įskiepis yra būtinas.','%s themes'=>'%s temos','Filter themes (%s)'=>'Filtruoti temas (%s)','Go to theme sources'=>'Grįžti į temos šaltinius','Search WordPress.org themes'=>'Ieškoti temos WordPress.org kataloge','Install &amp; Preview'=>'Įdiegti ir peržiūrėti','Invalid URL.'=>'Neteisingas URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Laikas pridėti nuorodų! Spustelėkite &#8220;%s&#8221; ir pridėkite nuorodas į puslapius, kategorijas ar puslapius internete. Pridėkite tiek, kiek tik jums reikia.','Choose image'=>'Pasirinkti paveikslėlį','Choose audio'=>'Pasirinkti audio','Change audio'=>'Pakeisti audio','Select audio'=>'Pasirinkti audio','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Dienovidinis','Minute'=>'Minutė','Hour'=>'Valanda','Time'=>'Laikas','Day'=>'Diena','Month'=>'Mėnuo','Date'=>'Data','Usage of user levels is deprecated. Use capabilities instead.'=>'Vartotojų lygių naudoti nerekomenduojama. Naudokite galimybes.','The theme defines itself as its parent theme. Please check the %s header.'=>'Ši tema apibūdina save kaip savo tėvinę temą. Patikrinkite %s antraštę.','Name for the Visual editor tabVisual'=>'Vaizdinis','Create New Menu'=>'Sukurti naują meniu','New Menu'=>'Naujas meniu','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Jeigu Jūsų tema turi valdiklių zoną, taip pat galite įterpti meniu ten. Aplankykite <a href="%s">valdiklių skydelį</a> ir pridėkite „Navigacijos meniu“ valdiklį, jei norite rodyti meniu šoninėje juostoje ar poraštėje.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Jeigu Jūsų tema turi keletą meniu, aiškūs pavaidinimai padės lengviau juos valdyti.','Your theme can display menus in %s location.'=>'Jūsų tema gali rodyti meniu %s vietoje.' . "\0" . 'Jūsų tema gali rodyti meniu %s vietose.' . "\0" . 'Jūsų tema gali rodyti meniu %s vietų.','Your theme can display menus in one location.'=>'Jūsų tema gali rodyti meniu vienoje vietoje.','CSS code'=>'CSS','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Redagavimo laukas automatiškai pažymi kodo sintaksę. Galite tai išjungti savo <a href="%1$s" %2$s>vartotojo profilyje%3$s</a>, kad veiktų tekstiniu rėžimu.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Ekrano skaityklių naudotojai: formų režime gali tekti Esc klavišą spausti du kartus.','To move away from this area, press the Esc key followed by the Tab key.'=>'Jei norite pereiti į kitą lauką, spustelėkite Esc, o tuomet Tab klavišą.','In the editing area, the Tab key enters a tab character.'=>'Redagavimo dalyje, Tab klavišas įveda tabuliacijos simbolį.','When using a keyboard to navigate:'=>'Naudojant navigaciją klaviatūra:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Pridėkite čia savo CSS kodą, jei norite specifiškai pakeisti savo tinklalapio išvaizdą ir išdėstymą.','Your homepage displays'=>'Pradžios puslapyje rodyti','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Galite pasirinkti, kas rodoma jūsų tinklalapio pradžios puslapyje. Tai gali būti įrašai atvirkštine chronologine tvarka (klasikinis tinklaraštis) arba fiksuotas statinis puslapis. Norėdami nustatyti statinį puslapį, pirmiausiai turite sukurti du puslapius. Vienas taps jūsų p